'Fastlane', is a dance DJ/producer from London. He has a unique talent for song writing, producing and illustrating epic remixes.

Fastlane has been able to make a musical blend of both Urban and House genres, satisfying the needs of today's party goers.
Fastlane has successfully signed to Devlin's management, EGA Music Group where he is currently working on his own album. His energetic personality and love for music will take this talented individual to good things in the future. 

